import itertools
def is_prime(number):
    if number <=2:
        return True
    for i in range(2,number):
        if (number % i == 0):
            return False
    else:
        return True
from math import sqrt

def is_prime_other(x):
    prime = False
    if x > 1:
        prime = True
        k = 2
        n = sqrt(x) # to find square of x only once (or n = x ** 0.5 to get rid of math module)
        while k <= n and prime == True:
            if x % k == 0:
                prime = False
            k += 1
    return prime

def kbits(n, k):
    result = []
    for bits in itertools.combinations(range(n), k):
        s = ['0'] * n
        for bit in bits:
            s[bit] = '1'
        if s[0] == '1' and s[-1] == '1':
            result.append(''.join(s))
    return result
def find_jamcoins(n,j):
    lst_jamcoins = []
    while len(lst_jamcoins) != j:
        for i in range(2,n):
            lst_perm = kbits(n,i)
          #  print(lst_perm)
            for perm in lst_perm:

                base = 2
                count = 0
                while base != 11:
                    new_perm = int(perm,base=base)
                    if not is_prime_other(new_perm):
                        count += 1
                    base += 1
                if count == 9:
                    lst_jamcoins.append(perm)
                    print(len(lst_jamcoins))
                if len(lst_jamcoins) == j:
                    return lst_jamcoins





def find_divisor(num):
    divisors = ''
    for i in range(2,11):
        new_num = int(num, base=i)
        k = 2
        n = sqrt(new_num)
        while k <= n:
            if new_num % k == 0:
                divisors += str(k) + ' '
                break
            k += 1
    return divisors

def convert(number):
    divisor = ''
    for i in range(2,11):
        divisor += str(int(number, i)) + ' '
    return divisor
